const getCountries = (start) => {
    const lst = [];
    const lowerCaseStart = start.toLowerCase(); // Convert start to lowercase once

    

    for (let index = 0; index < countries.length; index++) {
        const element = countries[index].trim(); // Trim any extra spaces



        // Check if the country starts with the provided input
        if (element.toLowerCase().startsWith(lowerCaseStart)) {
            lst.push(element);
        }

        // Break the loop after collecting 6 countries
        if (lst.length === 6) {
            break;
        }
    }

    return lst;
};

const LineChart_CO = (country, type) => {
    let data;
    if (type == 'DO') {
        data = COData[country];
    } else if (type == 'NOx') {
        data = NOData[country];
    } else if (type == "O3") {
        data = O3Data[country];
    }
    else {
        data = COData[country];
    }
    delete data.code;
    delete data.iso;
    const keys = Object.keys(data)
    const values = Object.values(data)
    return [keys, values];
}

const climateDesc=(country)=>{
    return climateChangeDescriptions[country]
}

